import React from "react";

export function TruckTile({ color, direction }) {
  function getDirection() {
    switch (direction) {
      case "U":
        return "rotate(0deg)"
      case "R":
        return "rotate(90deg)"
      case "D":
        return "rotate(180deg)"
      case "L":
        return "rotate(270deg)"
    }
  }

  return (
    <svg
      style={{ marginLeft: 5, transform: getDirection() }}
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width="50"
      height="50"
      fill="none"
      viewBox="0 0 50 50"
    >
      <rect width="50" height="50" fill={color || "#999999"} rx="10"></rect>
      <path fill="url(#pattern1)" d="M10 3H39V48H10z"></path>
      <defs>
        <pattern
          id="pattern1"
          width="1"
          height="1"
          patternContentUnits="objectBoundingBox"
        >
          <use
            transform="matrix(.0025 0 0 .00161 -.002 0)"
            xlinkHref="#image1"
          ></use>
        </pattern>
        <image
          id="image1"
          width="402"
          height="621"
          xlinkHref="data:image/png;base64,"
        ></image>
      </defs>
    </svg>
  );
}

